import React, { useState } from "react";

export const UseStateBasics = () => {
  const [state, setState] = useState("");

  return (
    <div>
      <h3>{`${state ? " title" : "Hello People"}`}</h3>
      <button type="button" onClick={() => setState(!state)}>
        Change title
      </button>
    </div>
  );
};
